function inputImageToBase64(input, callback) {
    let reader = new FileReader();
    reader.onload = function () {
        callback(reader.result);
    };
    reader.readAsDataURL(input);
}
class Pet {
    constructor(name, breed, age, pic) {
        this.name = name;
        this.breed = breed;
        this.age = age;
        this.pic = pic;
    }
}
class User {
    constructor(name, id, address, pic, tel, email, password = "1234", adm = false) {
        this.userName = name;
        this.userId = id;
        this.userAddress = address;
        this.userPic = pic;
        this.userTel = tel;
        this.userEmail = email;
        this.pets = [];
        this.adm = adm;
        this.password = password;
    }
}
class Product {
    constructor(name, pic, description, price, type, qtt) {
        this.name = name;
        this.pic = pic;
        this.description = description;
        this.price = price;
        this.type = type;
        this.qtt = qtt;
    }
}
class Service {
    constructor(name, description, price) {
        this.name = name;
        this.description = description;
        this.price = price;
    }
}
class Schedule {
    constructor(day, hour, customer, pet, service, creditCard, csc, expDate, cardFlag) {
        this.day = day;
        this.hour = hour;
        this.customer = customer;
        this.pet = pet;
        this.service = service;
        this.creditCard = creditCard;
        this.csc = csc;
        this.expDate = expDate;
        this.cardFlag = cardFlag;
    }
}
class Sale {

    constructor(customer, products, day, creditCard, csc, expDate, total, status) {

        this.customer = customer;
        this.products = products;
        this.day = day;
        this.creditCard = creditCard;
        this.csc = csc;
        this.expDate = expDate;
        this.total = total;
        this.status = status;
    }
}
