    login(usr, pw) {
        if (!this.users[usr])
            return false; // usurio no existe
        if (this.users[usr].password != pw)
            return false; // senha incorreta
        return true;
    }
    isAdmin(usr) {
        if (!this.users[usr])
            return false;
        return this.users[usr].adm;
    }
    addPet(user, name, breed, age, pic) {
        if (!this.users[user])
            return "Usurio no existe.";
        this.users[user].pets.push(new Pet(name, breed, age, pic));
        return "ok";
    }
    addUser(name, id, address, pic, tel, email, password, perm) {
        if (this.users[id])
            return "O ID fornecido j est sendo utilizado.";
        let isAdm = false;
        if (perm == "admin")
            isAdm = true;
        this.users[id] = new User(name, id, address, pic, tel, email, password, isAdm);
        return "ok";
    }
